    static selectQuizByIdFromDB = async (id) => {
        return await db.Quiz.findOne({
            where: {
                id: id
            }
        })
    }

    static getListQuiz = async () => {
        const listQuiz = await this.getAllQuizFromDB();
        let output = []
        for (let i = 0; i < listQuiz.rows.length; i++) {
            if (!_.isNull(listQuiz.rows[i].dataValues.image)) {
                listQuiz.rows[i].dataValues.image = listQuiz.rows[i].dataValues.image.toString('base64')
            }
            output.push(listQuiz.rows[i].dataValues)
        }
        return output
    }

    static getQuizById = async ({ id }) => {
        const result = await this.selectQuizByIdFromDB(+id);
        result.dataValues.image = result.dataValues.image.toString('base64')
        if (!result)
            return null
        return result.dataValues
    }

